import { Table } from "react-bootstrap";
import Event from "./Event";

const UpcomingEvent = ({ database, onDelete, onToggle }) => {
  const upcomingEvents = database.filter(
    (eve) => eve.date - new Date() > 0
  );

  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>Event Name</th>
          <th>Organiser</th>
          <th>Date</th>
          <th>Location</th>
        </tr>
      </thead>

      <tbody>
        {upcomingEvents.map((eve) => (
          <tr key={eve.id}>
            <td>{eve.id}</td>
            <td>{eve.text}</td>
            <td>{eve.organiser}</td>
            <td>{eve.date}</td>
            <td>{eve.location}</td>
          </tr>
        ))}
      </tbody>
    </Table>
  );
};

export default UpcomingEvent;
